window.bookSummaryJSON = "<p>There will be plenty of time for me to beat him soundly once I've gotten what I came for. </p> <p>Sent on a mission to retrieve an ancient hidden map - the key to a legendary treasure trove - 17-year-old pirate captain Alosa deliberately allows herself to be captured by her enemies, giving her the perfect opportunity to search their ship. </p> <p>More than a match for the ruthless pirate crew, Alosa has only one thing standing between her and the map: her captor, the unexpectedly clever and unfairly attractive first mate Riden. But not to worry, for Alosa has a few tricks up her sleeve, and no lone pirate can stop the <i>Daughter of the Pirate King</i>. </p> <p>In <i>Daughter of the Pirate King</i>, debut author Tricia Levenseller blends action, adventure, romance, and a little bit of magic into a thrilling YA pirate tale. </p>"; 
